function t_throttle(fn,threshhold,scope){var last;var deferTimer;threshhold||(threshhold=250);return function(){var context=scope||this;var now=+new Date();var args=arguments;if(last&&now<last+threshhold){clearTimeout(deferTimer);deferTimer=setTimeout(function(){last=now;fn.apply(context,args)},threshhold)}else{last=now;fn.apply(context,args)}}}
function t214__updateLazyLoad(recid){var scrollContainer=document.querySelector('#rec'+recid+' .t214__container_mobile-flex');var currentMode=document.querySelector('.t-records').getAttribute('data-tilda-mode');if(scrollContainer&&currentMode!=='edit'&&currentMode!=='preview'){scrollContainer.addEventListener('scroll',t_throttle(function(){if(window.lazy==='y'||document.getElementById('allrecords').getAttribute('data-tilda-lazy')==='yes'){t_onFuncLoad('t_lazyload_update',function(){t_lazyload_update()})}}))}}
function t930__paintIcons(recid){var rec=document.querySelector('#rec'+recid);if(!rec)return;var iconWrapper=rec.querySelector('.t930__icon-wrapper');if(!iconWrapper)return;var url=iconWrapper.getAttribute('data-original');var color=iconWrapper.getAttribute('data-color');var icons=iconWrapper.querySelectorAll('.t930__icon');if(!url||!color||!icons.length)return;var setIconBackground=function(backgroundValue){Array.prototype.forEach.call(icons,function(icon){icon.style.backgroundImage=backgroundValue})}
if(!color){setIconBackground('url('+url+')');return}
var xhr=new XMLHttpRequest();xhr.open('GET',url);xhr.responseType='document';xhr.onreadystatechange=function(){if(xhr.readyState===XMLHttpRequest.DONE&&xhr.status===200){var response=xhr.response;var svg=response.querySelector('svg');if(!svg)return;var figureList=svg.querySelectorAll('*:not(g):not(title):not(desc)');figureList.forEach(function(figure){figure.style.fill=color});var svgString=new XMLSerializer().serializeToString(svg);var svgEncodedURL='url(data:image/svg+xml;base64,'+window.btoa(svgString)+')';setIconBackground(svgEncodedURL)}else if(xhr.readyState===XMLHttpRequest.DONE){setIconBackground('url('+url+')')}};xhr.send()}